$(document).ready(function e(){$("#form-check").on("submit",function e(n){n.preventDefault();var t=n.currentTarget.action;$.ajax({type:"POST",url:t,dataType:"json",data:$(this).serialize(),success:function e(n){$("#check-results").val(n.result);$("#check-results").parents(".row").removeClass("d-none");console.log(n);if(n.status===true){$("#result-new-modal").find('input[name="_csrf"]').val(n.csrfToken);$("#check-results").parents(".row").addClass("d-none");$("#result-new-modal").find(".alert").removeClass("d-none").empty().append(n.message);$("#result-new-modal").modal("show")}}})})});$(document).ready(function e(){$("#form-new-result").on("submit",function e(n){n.preventDefault();var t=n.currentTarget.action;$.ajax({type:"POST",url:t,dataType:"json",data:$(this).serialize(),success:function e(n){window.location=n.location}})})});